description:
FA Cup Highlights 1st round 09.11.2014 

Duration: 1 hour 30 min

Manish Bhasin introduces highlights from the first round of the FA Cup. This weekend is always a big one as the non-league sides who have battled through the preliminary rounds look to extend their cup runs and make a name for themselves. Meanwhile, the 48 League One and League Two clubs who enter at this stage will be hoping to avoid being the victim of a giant-killing while harbouring their own dreams of cup glory.
